	add("friction", "{\"term\":\"friction\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027friction\u0027 and directly from Latin \u0027frictionem\u0027 nom. \u0027frictio\u0027 (a rubbing, rubbing down)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The rubbing of one object or surface against another\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/pub/2013/4/geothermal-energy Geothermal volume\u003d101|issue\u003d4|magazine\u003d|passage\u003dEnergy has seldom been found where we need it when we want it. Ancient nomads, wishing to ward off the evening chill and enjoy a meal around a campfire, had to collect wood and then spend time and effort coaxing the heat of \u0027\u0027friction\u0027\u0027 out from between sticks to kindle a flame\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Conflict, as between persons having dissimilar ideas or interests; clash\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A force that resists the relative motion or tendency to such motion of two bodies in contact\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1839\u0027\u0027, \u0027A Compendium of Astronomy\u0027 Page 9\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Secondly, When a body is once in motion it will continue to move forever, unless something stops it. When a ball is struck on the surface of the earth, the \u0027\u0027friction\u0027\u0027 of the earth and the resistance of the air soon stop its motion\", \"priority\":6}]}, \"synonyms\":{}}");

	add("friday", "{\"term\":\"friday\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"old norse\", \"old saxon\"], \"text\":\"From Old english (ca. 450-1100) {{m|ang|frƒ´ƒ°ed√¶ƒ°}}. Compound of frƒ´ƒ°e and d√¶ƒ° ‚Äúday‚Äù, corresponding to late Proto-germanic {{m|gem-pro|*Frijj≈çz dagaz||day of Frigg}}. Compare West Frisian \u0027freed\u0027 Low German \u0027freedag\u0027 Dutch \u0027vrijdag\u0027 German \u0027freitag\u0027 Danish \u0027fredag\u0027 Old norse {{m|non|Frigg}} (genitive {{m|no|Friggjar}}), Old saxon {{m|osx|Fri}}, and Old english (ca. 450-1100) {{m|ang|Frig}} are derived from Common Germanic {{m|gem-pro|*Frijj≈ç}}.[5] Frigg is cognate with Sanskrit prƒ´yƒÅÃÅ which means ‚Äúwife‚Äù.[5] The root also appears in Old Saxon \u0027fri\u0027 which means ‚Äúbeloved lady‚Äù; in Swedish \u0027fria\u0027, in Danish and Norwegian as \u0027fri\u0027 (‚Äúto propose for marriage‚Äù); a related meaning exists in Icelandic as \u0027frj√°\u0027 which means ‚Äúto love‚Äù and similarly in Dutch \u0027vrijen\u0027 meaning ‚Äúto make love (to have sex)‚Äù.A calque of Latin \u0027dies Veneris\u0027, via an association of the goddess Frigg with the Roman goddess of love Venus.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The sixth day of the week in many religious traditions, and the fifth day of the week in systems using the w:ISO ISO 8601 norm; the Biblical sixth day of a week, the day before the Sabbath, or ‚Äúday of preparation‚Äù in preparation for the Sabbath; the Islamic sabbath; it follows Thursday and precedes Saturday.\u0026lt;!--probably just an attributive form of the noun\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An appointment, person (like Man Friday in \u0027Robinson Crusoe\u0027), or feeling associated with this day of the week.--\u0026gt\", \"priority\":2}]}, \"synonyms\":{}}");

