	add("friend", "{\"term\":\"friend\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"West Frisian\", \"gothic\", \"Icelandic\", \"low german\", \"Dutch\", \"saterfriesisch\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) {{m|enm|frende}}, {{m|enm|frend}}, {{m|enm|freond}}, from Old english (ca. 450-1100) {{m|ang|frƒìond||friend, relative, lover|lit\u003dloving-[one]}}, from Proto-germanic {{m|gem-pro|*frij≈çndz||lover, friend}}, from Proto-indo-european {{m|ine-pro|*prƒìy-}}, {{m|ine-pro|*prƒÅy-||to like, love}}, equivalent to {{suffix|free|and|alt2\u003dnd|lang\u003den}}. Cognate with Saterfriesisch {{m|stq|Fr√º√ºnd||friend}}, West frisian {{m|fy|freon}}, {{m|fy|froen}}, {{m|fy|freondinne||friend}}, Dutch {{m|nl|vriend||friend}}, Low german {{m|nds|Frund}}, {{m|nds|Fr√ºnd||friend, relative}}, German {{m|de|Freund||friend}}, Danish {{m|da|fr√¶nde||kinsman}}, Swedish {{m|sv|fr√§nde||kinsman, relative}}, Icelandic {{m|is|fr√¶ndi||kinsman}}, Gothic {{m|got|êçÜêçÇêåπêåæêçâêåΩêå≥êçÉ||friend}}. More at {{l|en|free}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person other than a family member, spouse or lover whose company one enjoys and towards whom one feels affection\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|passage\u003dHowever, with the dainty volume my quondam \u0027\u0027friend\u0027\u0027 sprang into fame. At the same time he cast off the chrysalis of a commonplace existence\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A boyfriend or girlfriend\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An associate who provides assistance\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A person with whom one is vaguely or indirectly acquainte\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d2|page\u003d27|magazine\u003d|title\u003d[http://www.guardian.co.uk/technology/2013/may/10/conscious-computing-twitter-facebook-google The tao of passage\u003dThe dirty secret of the internet is that all this distraction and interruption is immensely profitable. Web companies like to boast about [\u0026amp;hellip;], or offering services that let you \u0026quot;stay up to date with what your \u0027\u0027friends\u0027\u0027 are doing\u0026quot;,and so on. But the real way to build a successful online business is to be better than your rivals at undermining people\u0027s control of their own attention\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A person who backs or supports something\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An object or idea that can be used for good\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Used as a form of address when warning someone\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"In object-oriented programming, a function or class granted special access to the private and protected members of another class\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, Tom Swan, \u0027Learning C\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"But don\u0027t take the following sections as an endorsement of \u0027\u0027friends\u0027\u0027. Top C++ programmers avoid using \u0027\u0027friends\u0027\u0027 unless absolutely necessary\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Stephen Prata, \u0027C++ primer plus\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"In that case, the function needn\u0027t (and shouldn\u0027t) be a \u0027\u0027friend\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, D S Malik, \u0027C++ Programming: From Problem Analysis to Program Design\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"To make a function be a \u0027\u0027friend\u0027\u0027 to a class, the reserved word \u0026lt;code\u0026gt;friend\u0026lt;/code\u0026gt; precedes the function prototyp\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A paramour of either sex\", \"priority\":17}]}, \"synonyms\":{}}");

