	add("friendom", "{\"term\":\"friendom\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|friend|dom|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being friends; friendhood\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Ari Meier, KaChiza Books, \u0027The Screambed Chronicles - Page 57\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"wife was there... but i didn\u0027t see her our definite roads crossed again this time wife and i became i and i feelings from ago-long time he was an associate going into \u0027\u0027friendom\u0027\u0027 only i wouldn\u0027t and couldn\u0027t let it evolve because i felt a plan because\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Allyson Beatrice, \u0027Will the Vampire People Please Leave the Lobby? - Page 12\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Fandom, \u0027\u0027friendom\u0027\u0027, and familydom all run on a gradient line in my brain. There\u0027s no hard shift between the ‚Äúdoms‚Äù; they just bleed into each other like watercolors on cheap paper\", \"priority\":5}]}, \"synonyms\":{}}");

