	add("frigg", "{\"term\":\"frigg\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old norse\"], \"text\":\"From Old norse \u0027frigg\u0027 from Proto-germanic {{m|gem-pro|*Frijj≈ç}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The wife of Odin, and the Norse/Germanic goddess of married love, the heavens, home and hearth, after whom Friday is named (due to her being identified with Venus\", \"priority\":1}]}, \"synonyms\":{}}");

	add("frigate", "{\"term\":\"frigate\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027fr√©gate\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An obsolete type of sailing warship with a single continuous gun deck, typically used for patrolling, blockading, etc, but not in line of battle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A 19th c. type of warship combining sail and steam propulsion, typically of ironclad timber construction, supplementing and superseding sailing ships of the battle line until made obsolete by the development of the solely steam-propelled iron battleship\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A modern type of warship, smaller than a destroyer, originally (WWII) introduced as an anti-submarine vessel but now general purpose\", \"priority\":3}]}, \"synonyms\":{}}");

	add("frigatebird", "{\"term\":\"frigatebird\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|frigate|bird|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of five species of bird in the genus \u0027Fregata\u0027, the only genus in the family Fregatidae\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, J. P. Croxall, \u0027Seabirds: Feeding Ecology and Role in Marine Ecosystems\u0027, [http://books.google.com.au/books?id\u003dFSU9AAAAIAAJ\u0026amp;pg\u003dPA58\u0026amp;dq\u003d%22frigatebird%22%7C%22frigatebirds%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003do6txU4bQNMWolAXmkoDYCw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22frigatebird%22%7C%22frigatebirds%22\u0026amp;f\u003dfalse page 58\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Unlike most seabirds, \u0027\u0027frigatebirds\u0027\u0027 are not able to alight on the water\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Penny Olsen, Leo Joseph, \u0027Stray Feathers: Reflections on the Structure, Behaviour and Evolution of Birds\u0027, [http://books.google.com.au/books?id\u003ddIz4KORv-wUC\u0026amp;pg\u003dPA176\u0026amp;dq\u003d%22frigatebird%22%7C%22frigatebirds%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003do6txU4bQNMWolAXmkoDYCw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22frigatebird%22%7C%22frigatebirds%22\u0026amp;f\u003dfalse page 176\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The oceanic \u0027\u0027frigatebirds\u0027\u0027 are represented in Australia by three species: the Great and Lesser \u0027\u0027Frigatebirds\u0027\u0027 and endemic Christmas Island \u0027\u0027Frigatebird\u0027\u0027 (pictured\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, David Horwell, Pete Oxford, \u0027Gal√°pagos Wildlife\u0027, 3rd Edition, [http://books.google.com.au/books?id\u003dYfrvysRy30YC\u0026amp;pg\u003dPA64\u0026amp;dq\u003d%22frigatebird%22%7C%22frigatebirds%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003do6txU4bQNMWolAXmkoDYCw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22frigatebird%22%7C%22frigatebirds%22\u0026amp;f\u003dfalse page 64\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Often called man o\u0027 war birds, they are notorious as piratical cleptomaniacs that steal food from other birds at every opportunity. This reputation is justified, but \u0027\u0027frigatebirds\u0027\u0027 are also capable of an \u0027honest\u0027 living\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"It would seem that a \u0027\u0027frigatebird\u0027\u0027 can discriminate between a bird with a full gullet and one which is empty. An unlucky booby or tropicbird may be plucked out of the air, dangled by the tail-tip and shaken until it regurgitates its food, which the \u0027\u0027frigatebird\u0027\u0027 then makes off with\", \"priority\":11}]}, \"synonyms\":{}}");

