	add("friggatriskaidekaphobia", "{\"term\":\"friggatriskaidekaphobia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"old norse\"], \"text\":\"From \u0027frigga\u0027 (an English variant of Old norse \u0027frigg\u0027 the Norse goddess for whom Friday was named) + Ancient greek (to 1453) \u0027œÑœÅŒµ·øñœÇ\u0027 (three) + Ancient Greek \u0027Œ∫Œ±ŒØ\u0027 (and) + Ancient Greek \u0027Œ¥Œ≠Œ∫Œ±\u0027 (ten) + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fear of Friday the thirteenth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, R. W. A. Mitchell, \u0027Ask a Little-Learn a Lot: How Questions Change Everything\u0027, iUniverse (2012), ISBN 9781475933789, [http://books.google.com/books?id\u003d98soUQHzPLAC\u0026amp;pg\u003dPA90\u0026amp;dq\u003d%22friggatriskaidekaphobia%22 page 90\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The fear of Friday the thirteenth, or \u0027\u0027\u0027friggatriskaidekaphobia\u0027\u0027\u0027, takes the thirteen superstition to a whole new level\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Sara Latta, \u0027Scared Stiff: Everything You Need to Know About 50 Famous Phobias\u0027, Zest Books (2013), ISBN 9781936976492, [http://books.google.com/books?id\u003dMXc0AQAAQBAJ\u0026amp;pg\u003dPA186\u0026amp;dq\u003d%22friggatriskaidekaphobia%22 page 186\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Friggatriskaidekaphobia\u0027\u0027 is probably the most common superstition in the United States; according to researchers, it affects 17 to 21 million people\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Rachel Wise, \u0027Breaking News\u0027, Simon Spotlight (2013), ISBN 9781442489653, [http://books.google.com/books?id\u003dHY_zAQAAQBAJ\u0026amp;pg\u003dPA2\u0026amp;dq\u003d%22friggatriskaidekaphobia%22 page 2\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"So I started Googling, and I found some interesting information about ‚Äú\u0027\u0027friggatriskaidekaphobia\u0027\u0027.‚Äù (That\u0027s the actual term for the condition of the fear of Friday the thirteenth\", \"priority\":7}]}, \"synonyms\":{}}");

	add("fright", "{\"term\":\"fright\", \"etymology\":{\"influencers\":[{},{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"middle dutch (ca. 1050-1350)\", \"English\", \"middle english (1100-1500)\", \"gothic\", \"low german\", \"old frisian\", \"Romanian\", \"scots\", \"Albanian\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027fright\u0027 \u0027furht\u0027 from Old english (ca. 450-1100) \u0027fryhtu\u0027 \u0027fyrhto\u0027 (fright, fear, dread, trembling, horrible sight) from Proto-germanic {{m|gem-pro|*furhtƒØÃÑ||fear}}, from Proto-indo-european {{m|ine-pro|*perg-||to frighten; fear}}.Cognate with Scots \u0027fricht\u0027 (fright) Old frisian \u0027fruchte\u0027 (fright) Low german \u0027frucht\u0027 (fright) Middle dutch (ca. 1050-1350) \u0027vrucht\u0027 German \u0027furcht\u0027 (fear, fright) Danish \u0027frygt\u0027 (fear) Swedish \u0027fruktan\u0027 (fear, fright, dread) Gothic \u0027êçÜêå∞êåøêçÇêå∑êçÑêå¥êåπ\u0027 (fear, horror, fright) Albanian \u0027frik√´\u0027 (fear, fright, dread, danger) and Romanian \u0027fricƒÉ\u0027 (fear, fright, dread) are also cognates, although probably influenced by an early Germanic variant.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A state of terror excited by the sudden appearance of danger; sudden and violent fear, usually of short duration; a sudden alarm\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, \u0027\u0027 Chapter 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"With a bolt of \u0027\u0027fright\u0027\u0027 he remembered that there was no bathroom in the Hobhouse Room. He leapt along the corridor in a panic, stopping by the long-case clock at the end where he flattened himself against the wall\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Anything strange, ugly or shocking, producing a feeling of alarm or aversion\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1819\u0027\u0027, Lord Byron, \u0027Don Juan\u0027, I\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Her maids were old, and if she took a new one\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"You might be sure she was a perfect \u0027\u0027fright\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"She did this during even her husband\u0027s lif\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"I recommend as much to every wife\", \"priority\":9}]}, \"synonyms\":{}}");

	add("frigidaire", "{\"term\":\"frigidaire\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Proprietary name of a brand of refrigerators.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A refrigerator\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He [...] had everything necessary to the Modern Man, / A phonograph, a radio, a car and a \u0027\u0027frigidaire\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, \u0027Constance\u0027, Penguin 2004 (\u0027Avignon Quintet\u0027), p. 659\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Carpets were spread, divans appeared, as also the latest creation from Italy, a portable \u0027\u0027frigidaire\u0027\u0027 which held countless bowls of sorbet and iced lemon tea.Category:English genericized trademarks\", \"priority\":4}]}, \"synonyms\":{}}");

