	add("frill", "{\"term\":\"frill\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A strip of pleated material used as decoration or trim; a ruffle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A wrinkled edge to a film\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A luxury\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Something extraneous added for effect\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Mind you, clothes were clothes in those days. [\u0026amp;hellip;]\u0026amp;nbsp; \u0027\u0027Frills\u0027\u0027, ruffles, flounces, lace, complicated seams and gores: not only did they sweep the ground and have to be held up in one hand elegantly as you walked along, but they had little capes or coats or feather boas\", \"priority\":5}]}, \"synonyms\":{}}");

