	add("frippery", "{\"term\":\"frippery\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027friperie\u0027. From Old French \u0027fripier\u0027 (to rub up and down, to wear into rags) Compare \u0027fripper\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Ostentation, as in fancy clothing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Useless things; trifles\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1892\u0027\u0027 April, \u0027Report by F.L.O.\u0027, quoted in \u0027\u00272003\u0027\u0027, w:Erik Erik Larson, \u0027w:The Devil in the White The Devil in the White City: Murder, Magic, and Madness at the Fair that Changed America\u0027, New York, N.Y.: , ISBN 978-0-609-60844-9, page 170\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Olmsted reiterated his insistence that in Chicago] simplicity and reserve will be practiced and petty effects and \u0027\u0027frippery\u0027\u0027 avoided\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"date\u003d21 October passage\u003dw:Oscar [Oscar] Pistorius\u0027s punishment for killing her \u0026amp\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"91;\u0026amp\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"93; that night is but a \u0027\u0027frippery\u0027\u0027 when set against the burden that her bereft parents, June and Barry, must carry\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Cast-off clothes\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"edition\u003d|url\u003dhttp://books.google.com/books?id\u003dU_VDAAAAYAAJ\u0026amp;pg\u003dPA97|passage\u003dYet, if thou dost, come over, and but see our \u0027\u0027frippery\u0027\u0027; change an old shirt for a whole smock with us\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The trade or traffic in old clothes\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The place where old clothes are sold\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1610\u0027\u0027, \u0027s:The The Tempest\u0027, by w:William Shakespeare, act 4 scene\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"O, ho, monster! we know what belongs to a \u0027\u0027frippery\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Hence: secondhand finery; cheap and tawdry decoration; affected elegance\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Fond of gauze and French \u0027\u0027frippery\u0027\u0027.\u0027 \u0026amp;mdash; w:Oliver Oliver Goldsmith\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The gauzy \u0027\u0027frippery\u0027\u0027 of a French translation.\u0027 \u0026amp;mdash; w:Sir W. Sir W. Scott\", \"priority\":16}]}, \"synonyms\":{}}");

	add("frisco", "{\"term\":\"frisco\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Shortening of \u0027san francisco\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"San Francisco, California\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1968\u0027\u0027, w:Otis Otis Redding, \u0027w:(Sittin\u0027 on) the Dock of the (Sittin\u0027 on) the Dock of the Bay\u0027 (song\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Left my home in Georgia, headed for the Frisco Bay, I had nothin\u0027 to live for, looks like nothin\u0027s gonna come my way, I\u0027m just sittin\u0027 on the dock of the bay, watchin\u0027 the tide roll away, sittin\u0027 on the dock of the bay, wastin\u0027 time\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1872,\u0027\u0027 \u0026quot;Emperor\u0026quot; w:Joshua A. Joshua A. Norton, \u0027Edict\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Whoever after due and proper warning shall be heard to utter the abominable word \u0026quot;Frisco,\u0026quot; which has no linguistic or other warrant, shall be deemed guilty of a High Misdemeanor, and shall pay into the Imperial Treasury as penalty the sum of twenty-five dollars\", \"priority\":5}]}, \"synonyms\":{}}");

	add("frisian", "{\"term\":\"frisian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Germanic or language (see Usage notes), or a lect thereof, which descended from Old Frisian, with speakers in the Netherlands, Germany and Denmark\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The West Frisian lect, spoken in the northern Netherlands\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Colin Baker, Sylvia Prys Jones, \u0027Encyclopedia of bilingualism and bilingual education\u0027, page 405\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In the province of Friesland, in the north of the Netherlands, a high percentage of the population, about 350000\u0026lt;!--percent? wow. hehe--\u0026gt;, speak \u0027\u0027Frisian\u0027\u0027 as their first language\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Jasone Cenoz, Ulrike Jessner, \u0027English in Europe: the acquisition of a third language\u0027, page 223\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"This means that full competence in both \u0027\u0027Frisian\u0027\u0027 and Dutch (ie understanding, speaking, reading and writing ability) is aimed at all pupils in the province, whether they speak \u0027\u0027Frisian\u0027\u0027 or Dutch at home\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Pat Seward, Sunandini Arora Lal, \u0027Netherlands\u0027, page 89\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Many Frisians speak \u0027\u0027Frisian\u0027\u0027 at home and Dutch at work\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Saterland Frisian, the last surviving dialect of the East Frisian lect, spoken in Northern Germany close to the Dutch border\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The North Frisian lect, spoken in Germany and Denmark at the mutual border in Schleswig and Holstein\", \"priority\":10}]}, \"synonyms\":{}}");

